<script>
function setDisplay(){
let g = document.getElementsByTagName('G');
for(let i = 0; i < g.length; i++){
g[i].style.display = "none";
Display(g[i].id);
}
}//end setDisplay()
function Display(layer){
if(document.getElementById(layer).style.display == "none"){
document.getElementById(layer).style.display = "block";
}
else{
document.getElementById(layer).style.display = "none";
}
}//end Display()
function zoomIn(){
pcb = document.getElementById('viewport');
if(pcb.style.zoom < 8.0){
pcb.style.zoom *= 1.3;
}
}//end zoomIn()
function zoomOut(){
pcb = document.getElementById('viewport');
if(pcb.style.zoom > 0.3){
pcb.style.zoom *= 0.7;
}
}//end zoomIn()
function zoomReset(){
document.getElementById('viewport').style.zoom = 1.0;
}//end zoomIn()
